"use strict";

var _index = require("./index");

test('provide access to file and path ciphers', function (done) {
  (0, _index.Rclone)({
    password: '',
    salt: ''
  }).then(function (rclone) {
    expect(rclone).toMatchSnapshot();
    done();
  });
});
test('should return keys using getKeys()', function (done) {
  (0, _index.Rclone)({
    password: '',
    salt: ''
  }).then(function (rclone) {
    var keys = rclone.getKeys();
    expect(keys.dataKey).toBeInstanceOf(Uint8Array);
    expect(keys.nameKey).toBeInstanceOf(Uint8Array);
    expect(keys.nameTweak).toBeInstanceOf(Uint8Array);
    expect(keys.password).toEqual('');
    expect(keys.salt).toEqual('');
    done();
  });
});